import React, { Component } from "react";
import { useState, useEffect } from "react";
import axios from "axios";
import { PDFDownloadLink, pdf, BlobProvider } from "@react-pdf/renderer";
// import { API_KEY } from "./constants";
import base64 from "react-native-base64";
import EmailCertificate from "./EmailCertificate";
import { Button } from "react-bootstrap";
import { UserContext } from "../context/user";
import jsPDF from "jspdf";
import PDFViewer from "pdf-viewer-reactjs";

export default function Certificate() {
  const context = React.useContext(UserContext);
  const [firstName, setFirstName] = React.useState("");
  const [lastName, setLastName] = React.useState("");

  //The pdf document  https://rawgit.com/MrRio/jsPDF/master/docs/jsPDF.html

  var doc = new jsPDF("l", "pt");

  //Fetch the logged-in User details
  React.useEffect(() => {
    console.log(context.user.username);
    const requestOptions = {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({
        email: context.user.username,
      }),
    };
    console.log("request ");
    console.log(requestOptions);
    fetch(
      "https://web-service-g19-quiz-app.herokuapp.com/getDetails",
      requestOptions
    )
      .then((response) => response.json())
      .then((data) => {
        console.log(data);

        if (data.data === "success") {
          setFirstName(data.firstName);
          setLastName(data.lastName);
        } else {
          alert(data.message);
        }
      });
  }, []);

  console.log(firstName);
  //Adding image to pdf by adding Base64 encoded value
  var certiword =
    "data:image/png;base64,";
      //Adding image to pdf by adding Base64 encoded value

  var certidata =
    "data:image/png;base64,";

  //Base64 encoding for image
  var logodata =
    "data:image/png;base64,";

    //Set border to certificate https://www.c-sharpcorner.com/UploadFile/b629e0/implementation-of-graphics-using-jspdf/
  doc.rect(5, 5, 830, 585);
  doc.rect(10, 10, 820, 575);
  doc.setDrawColor(255, 0, 0);    

  doc.addImage(certiword, "png", 320, 50, 220, 100);
  doc.addImage(certidata, "png", 380, 150, 100, 100);
  doc.setFont("helvetica");

  doc.setFontSize(18);

  // Add First name and Last name of the user in the certificate
  doc.text(
    140,
    300,
    "This is to certifiy that " +
      firstName +
      " " +
      lastName +
      " has completed the Quiz successfully"
  );
  doc.text(380,350,"Director X.Y");

  doc.addImage(logodata, "png", 350, 400, 170, 120);

  doc.output("blob");

  // Encode the Document to Base64 for Rendering

  var out1 = doc.output();

  //Base64 of PDF
  var pdfview = base64.encode(out1);

  //Locally storing PDF Base64 value
  window.localStorage.setItem("pdfGen", pdfview);

  var url1 = "data:application/pdf;base64," + base64.encode(out1);

  //Download the certificate in PDF format
  const onSubmit = (e) => {
    doc.save("certi.pdf");
  };

  // https://github.com/ansu5555/pdf-viewer-reactjs  For rendering PDF online from Base64
  const PdfRender = () => (
    <div className="col-sm-12 text-center pdfview">
      <div className="border rounded pdfview">
        <PDFViewer
          document={{
            base64: pdfview,
          }}
          hideZoom
          hideRotation
          scale={0.8}
          hideNavbar
        />
      </div>
    </div>
  );

  return (
    <div>
      <div id="content">
        <h2 class="text-center">Certificate </h2>
        <h3 class="text-center">
          Congratulations on completing the quiz successfully.
        </h3>
        <div className="row pdfview">
          <PdfRender />
        </div>
        <h3 class="text-center">Click on Download button to view your pdf</h3>
      </div>
      <div class="row">
        <div class="col-md-6">
          <div class="pt-1 pb-3 float-right">
            <Button variant="primary" onClick={(e) => onSubmit(e)}>
              Download
            </Button>
          </div>
        </div>
        <div class="col-md-6">
          <EmailCertificate></EmailCertificate>
        </div>
      </div>

      <div></div>
    </div>
  );
}
